subproject.description:
1: Wetland biodiversity conservation is a routine consideration in government decision making and action at national level;
2: Heilongjiang provincial level government agencies routinely consider wetland biodiversity conservation in decision making and action;
3: Government agencies at local levels routinely take into account wetland biodiversity conservation in decision making and action at four wetland sites;
4: Improved processes of monitoring and evaluation, and the collection, analysis, use and sharing of information, knowledge and experience in wetland biodiversity conservation.
